import About1 from "../../assets/about1.webp";
import About2 from "../../assets/about1.webp";
import About3 from "../../assets/about1.webp";

function About() {
  return (
    <div>
      <div>
        <img src={About1} />
        <p>
          <h2>About Roche</h2>
          <p>
            We focus on discovering new medicines, diagnostics and digital
            health solutions that improve health outcomes so that we all have
            more time with the people we love.
          </p>
        </p>
      </div>
      <div>
        <p>
          <h2>Solutions</h2>
        </p>
        <img src={About2} />
      </div>
      <div>
        <img src={About3} />
        <p></p>
      </div>
    </div>
  );
}

export default About;
